import React, { Component } from 'react';
import Board from './Board'

class Game extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return (
            <div className="game">
                <div className="game-board">
                    <Board />
                </div>
                <div className="game-info">
                    {/* <Board /> */}
                </div>
            </div>
        );
    }
}
 
export default Game;
